INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (7, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (7, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -363.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (7, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -363.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7003);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (10, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -363.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (10, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (10, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -363.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10003);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (10, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 2, 0.0, 0.0, 2104010, 106401, 1, 1, -363.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10004);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (12, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -416.5, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (13, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (13, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -363.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (13, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 2, 0.0, 0.0, 2104010, 106401, 1, 1, -363.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13003);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (13, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -363.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13004);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (14, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -363.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (14, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 2, 0.0, 0.0, 2104010, 106401, 1, 1, -363.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (14, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -363.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14003);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (14, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14004);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (15, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -470.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (16, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 2, 0.0, 0.0, 2104010, 106401, 1, 1, -363.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (16, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -363.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (16, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16003);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (16, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -363.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16004);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (17, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -363.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (25, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 17004);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (25, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -363.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 17005);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (25, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 2, 0.0, 0.0, 2104010, 106401, 1, 1, -363.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 17006);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (25, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -363.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 17007);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (18, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 1, 1, -363.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (18, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 2, 1, -363.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (19, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 3, 1, -470.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (19, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 4, 1, -470.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (20, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 5, 1, -470.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (20, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 6, 1, -470.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (21, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (21, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -363.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (21, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 2, 0.0, 0.0, 2104010, 106401, 1, 1, -363.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21003);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (21, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -363.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21004);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (22, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 1, 1, -430.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (22, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 2, 1, -430.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (23, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 3, 1, -430.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (23, "カリン", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 4, 1, -430.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 8.0, 4.08, 0, 109001, 1, 2, -385.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 8.0, 5.0, 0, 109001, 2, 2, -385.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 8.0, 10.11, 0, 109001, 3, 2, -385.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24003);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 8.0, 4.0, 0, 109001, 4, 2, -385.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24004);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 8.0, 6.0, 0, 109001, 5, 2, -385.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24005);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109002, 6, 1, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24006);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109002, 7, 1, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24007);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109002, 8, 1, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24008);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109002, 9, 1, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24009);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "エリコ（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109002, 10, 1, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24010);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 8.0, 2.12, 0, 109101, 1, 2, -385.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24011);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 5, 8.0, 4.19, 0, 109101, 2, 2, -385.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24012);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 2, 8.0, 2.3, 0, 109101, 3, 4, -385.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24013);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109102, 4, 1, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24014);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 5, 8.0, 5.23, 0, 109101, 5, 2, -385.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24015);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109102, 6, 1, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24016);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 8.0, 5.01, 0, 109101, 7, 2, -385.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24017);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109102, 8, 1, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24018);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109102, 9, 1, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24019);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (24, "シズル（バレンタイン）", "2019/01/31 12:00:00", "2030/12/17 14:59:59", 10011, 1, 0.0, 0.0, 0, 109102, 10, 1, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24020);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (26, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 2, 0.0, 0.0, 2104010, 106401, 1, 1, -363.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (26, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -363.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 26002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (26, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 26003);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (26, "コッコロ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105901, 1, 1, -363.0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 26004);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (27, "シェフィ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 2, 0.0, 0.0, 2104010, 106401, 1, 1, -363.0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 27001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (27, "ペコリーヌ", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 105801, 1, 1, -363.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 27002);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (27, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 27003);
