INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (28, "カリン", "2019/09/24 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 190801, 1, 1, -363.0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 28001);
