INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (43, "キャル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 106001, 1, 1, -363.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43003);
