INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (44, "アメス", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 123001, 2, 1, -416.5, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 43005);
