INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (46, "アメス", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 1, 0.0, 0.0, 0, 123001, 1, 1, -371.5, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46001);
INSERT INTO `v1_f2ce9a9e937c4af97424311c12fb136007e6bd429e845502704ad84842e19a5b` VALUES (47, "シズル", "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0, 2, 0.0, 0.0, 0, 104901, 1, 2, -416.5, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47001);
